import sjsResume from '../../Assets/Resume.png';

const handleSubmit = (event) => {
  event.sjsResume()
}

export default function Resume() {
  return (
    <div>
      <h1 className="display-4 mb-4">Resume</h1>
      <a
          href="#portfolio"
          onClick={() => handlesubmit('Portfolio')}
          // Check to see if the currentPage is `Portfoliog`, and if so we use the active link class from bootstrap. Otherwise, we set it to a normal nav-link
          className={currentPage === 'Portfolio' ? 'nav-link active' : 'nav-link'}
        >
        </a>      <img src={sjsResume} className="img-fluid col-lg-5" alt="Seamona Resume"/>
    </div>
  );
}
